import logo from './logo.svg';
import './App.css';

function App() {


  let post = "youtube list";


  return (
    <div className="App">
      <div className="black-nav">
        <h4>BLOG</h4>
      </div>
      <h3>BLOG LIST</h3>
      <h4 id={post}>
        blogs
      </h4>
      <h3>{ post }</h3>
    </div>
  );
}

export default App;
